import React from "react";

import { makeStyles } from "@material-ui/core/styles";
import "../css/footer.css";

const useStyles = makeStyles({
  root: {
    flexGrow: 1
  },
  menuButton: {
    marginRight: "24px"
  },
  title: {
    flexGrow: 1,
    marginLeft: "24px"
  },
  test: {
    marginLeft: "24px",
    marginRight: "24px"
  }
});
function Footer() {
  const classes = useStyles();
  return (
    <div className="footer_container">
      <div className={classes.test}>
        <h2>Maestroprog's Dev Blog</h2>
        <b>양정훈의 기술 블로그</b>
        <p>React Express MongoDB Node.js를 좋아함</p>
        <p>010-7193-8984</p>
        <p>maestroprog@naver.com</p>
      </div>
    </div>
  );
}

export default Footer;
